const fs = require('fs');
const Jimp = require('jimp');
const jpeg = require('jpeg-js');

//预测函数
function forecast(image_path, cb = function(){}) {
    if(typeof image_path !== 'string') throw new Error('Invalid image path');
    if(cb && typeof cb !== 'function') throw new Error('Invalid callback function');

    predictImage(image_path, cb);
}

//预测新图像
function predictImage(image_path, cb) {

    Jimp.read(image_path).then(function (image) {
        let obj = {};
        let images = splitImageTo4Parts(image);
        let promises_task = decodeImageToTypedArray(images, obj);
        Promise.all(promises_task).then(function () {

            let predict_digits = [];
            for(let i = 0; i < 4; i++) {
                let _in = obj[`code_${i}`];
                let _ou = predict(_in);
                let {'0' : d0, '1' : d1, '2' : d2, '3' : d3,
                    '4' : d4, '5' : d5, '6' : d6, '7' : d7,
                    '8' : d8, '9' : d9} = _ou;
                _ou = [d0, d1, d2, d3, d4, d5, d6, d7, d8, d9];
                let predict_digit = _ou.indexOf(Math.max(..._ou));
                predict_digits.push(predict_digit);
            }
            predict_digits = predict_digits.join('');

            //返回四位数字组成的字符串
            cb(predict_digits);

        });

    });
}

//提取像素到矩阵
function extractPixel(typed_array) {
    if(typed_array.length % 4 !== 0) throw new Error('Pixel Not In RGBA Format');
    let pixels = [];
    for(let i = 0; i < typed_array.length; i = i + 4) {
        let pixel = [typed_array[i], typed_array[i + 1], typed_array[i + 2], typed_array[i + 3]];
        pixels.push(pixel);
    }
    return pixels;
}

//图像二值化
function binarizeImage(pixels) {
    for(let i = 0; i < pixels.length; i++) {
        if(pixels[i][1] > 127)
            pixels[i] = 1;
        else
            pixels[i] = 0;
    }
    return pixels;
}

//分割图片成4个数字
function splitImageTo4Parts(img) {
    const single_digit_width = img.bitmap.width / 4.2;
    const single_digit_height = img.bitmap.height * 0.8;
    const single_digit_y = 2;

    let i0 = img.clone();
    i0.crop(1, single_digit_y, single_digit_width, single_digit_height);
    let i1 = img.clone();
    i1.crop(single_digit_width, single_digit_y, single_digit_width, single_digit_height);
    let i2 = img.clone();
    i2.crop(single_digit_width * 2, single_digit_y, single_digit_width, single_digit_height);
    let i3 = img.clone();
    i3.crop(single_digit_width * 3, single_digit_y, single_digit_width, single_digit_height);

    return [i0, i1, i2, i3];
}

//将单个数字图片转换成扁平的二值化数组
function decodeImageToTypedArray(images, files_typed_array) {
    let promises = [];
    for (let _img = 0; _img < images.length; _img++) {
        let _promise_get_array =
            new Promise(function (__resolve) {
                images[_img].getBuffer(Jimp.MIME_JPEG, function (err, buffer) {
                    __resolve(buffer);
                });
            }).then(function (buffer) {
                return new Promise(function (_resolve) {
                    files_typed_array[`code_${_img}`] =
                        binarizeImage(extractPixel(jpeg.decode(buffer, true).data));
                    _resolve();
                });
            });

        promises.push(_promise_get_array);
    }
    return promises;
}

